    (NULL,'19.2.0','https://www.realta.co.id/hr/',NULL,79,'blog','com_content','Blog','blog',NULL,NULL,1,'{"category_layout":"","image":""}',NULL,NULL,'{"author":"","robots":""}','2018-09-06 14:51:05','0000-00-00 00:00:00',0,'*',1,'admin',1,NULL,351,'REALTA','admin','realta@realta.co.id','$2y$10$JlCoprDK6vy60FcdTaIfOekLt4qoCUoFF.Mq18EYK4063FlfsE2CS',0,1,'2018-09-06 14:51:06','2021-05-11 11:12:47',0,'{"admin_style":"","admin_language":"","language":"","editor":"","helpsite":"","timezone":""}','0000-00-00 00:00:00',0,NULL,NULL,0,'["Public","Super Users"]',NULL,108,'Employee Monitoring and Tracing','employee-monitoring-and-tracing','<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Meskipun pandemi belum benar-benar berakhir, pada saat ini sudah dapat dikategorikan sebagai keadaan New Normal. Berubahnya situasi membuat perkantoran mulai memberlakukan Work From...</span></p>','<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><span style="font-size: 14.6667px;"><img style="display: block; margin-left: auto; margin-right: auto;" src="images/monitoring.png" alt="Employee Monitoring and Tracing | attendance management software " /></span></span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"><br /><span style="font-size: 14.6667px;">Meskipun pandemi belum benar-benar berakhir, pada saat ini sudah dapat dikategorikan sebagai keadaan New Normal. Berubahnya situasi membuat perkantoran mulai memberlakukan Work From.</span> Office atau bekerja dari kantor. Meskipun sudah dapat bekerja di kantor, karena pandemi belum berakhir, maka ada prosedur-prosedur yang butuh dilakukan agar memutus rantai penyebaran COVID-19.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Ini berarti bahwa kantor wajib menaati protokol kesehatan yang ditetapkan pemerintah. Beberapa diantaranya adalah menggunakan masker, mencuci tangan secara berkala dan menjaga jarak dengan karyawan lain. Kemudian, perusahaan juga dihimbau untuk tidak menggunakan alat bersama seperti mesin absensi. Pengecekan suhu tubuh dan melakukan </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">swab test</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> secara berkala juga butuh dilakukan. Pematuhan protokol kesahatan ini agar kantor tidak menjadi </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">cluster</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> baru penyebaran COVID-19.</span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">Akan tetapi dengan perkantoran mulai memberlakukan WFO, area perkantoran menjadi cluster baru penyebaran COVID-19. Hal ini yang menyebabkan perlunya untuk memonitor kesehatan karyawan. Hal ini disebabkan bahwa pembawa virus COVID-19 memiliki kemungkinan untuk tidak menunjukan gejala, tetapi sudah bisa menularkan atau yang biasa disebut sebagai Orang Tanpa Gejala (OTG). Perusahaan tentunya ingin menghindari kantornya menjadi </span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: italic; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">cluster</span><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;"> penyebaran virus COVID-19. Jadi, data pemeriksaan suhu tubuh karyawan butuh direkam menggunakan sistem yang akurat. </span></p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"> </p>
<p dir="ltr" style="line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;"><span style="font-size: 11pt; font-family: Arial; color: #000000; background-color: #ffffff; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;">PT Realta Chakradarma memiliki solusi pemeriksaan suhu tubuh sebelum karyawan masuk kantor. Solusi ini juga dapat memonitor dan merekam suhu tubuh karyawan secara akurat. Pemeriksaan suhu tubuh dapat dilakukan secara bersamaan dengan absensi serta tidak membutuhkan sentuhan. Selain itu solusi ini juga mampu untuk mendeteksi pengunaan masker pada karyawan. </span></p>
<p> </p>
